package com.thalhamer.numbersgame.domain;import java.util.List;/** * Created by Brian on 5/12/2015. */public class SectionUnlock {    private Integer numOfStars;    private Integer epic;    private Integer section;    private List<Power> powers;    private int unlocked;    public Integer getNumOfStars() {        return numOfStars;    }    public void setNumOfStars(Integer numOfStars) {        this.numOfStars = numOfStars;    }    public Integer getEpic() {        return epic;    }    public void setEpic(Integer epic) {        this.epic = epic;    }    public Integer getSection() {        return section;    }    public void setSection(Integer section) {        this.section = section;    }    public List<Power> getPowers() {        return powers;    }    public void setPowers(List<Power> powers) {        this.powers = powers;    }    public int getUnlocked() {        return unlocked;    }    public void setUnlocked(int unlocked) {        this.unlocked = unlocked;    }}